import React from 'react'; //Reactを読み込んでいる

//画面遷移で使用する{ BrowserRouter, Route, Switch }を'react-router-dom'から読み込んでいる
import { Routes ,Route ,useLocation } from "react-router-dom";
import Signup from './components/Signup'; //作成したpage1.jsを読み込んでいる
import Page2 from './components/Page2'; //作成したpage1.jsを読み込んでいる
import LoginFormAction from './components/LoginFormAction'; //作成したpage1.jsを読み込んでいる
import validate from './validate';


const Router = () => {

    /**
     * Todo のためのパラメーター取得項目
     */
    const Validate = new validate();
    let location = useLocation();
    let urlnum = location.pathname.replace("/","");
    let todonum = "/0";
    if (Validate.isNum(urlnum)) {
        todonum = `/${urlnum}`;
    }

    return (
        <>
            <Routes>
                <Route path="/login" element={<LoginFormAction />} /> //URLのパスが'/'のみの時にpage1を表示する
                <Route path="/signin" element={<Signup />} /> //URLのパスが'/'のみの時にpage1を表示する
                <Route path={todonum} element={<Page2 />} /> //URLのパスが'/'のみの時にpage1を表示する
            </Routes>
        </>
    );
}

export default Router;
